A quick example showing how to send 10 messages, and then print the current user's name: use dawn::{ http::Client, model::id::ChannelId,
};
use futures::future;
use std::{env, error::Error}; #[tokio::main]
async fn main() -> Result<(), Box<dyn Error + Send + Sync>> { let client = Client::new(env::var("DISCORD_TOKEN")?); let channel_id = ChannelId(620980184606048278); future::join_all((1u8..=10).map(|x| { client.create_message(channel_id).content(format!("Ping #{}", x)) })).await; let me = client.current_user().await?; println!("Current user: {}#{}", me.name, me.discriminator); Ok(())
}

