Starting a Shard and printing the contents of new messages as they come in: use futures::StreamExt;
use dawn::gateway::{Config, Event, Shard};
use std::{ env, error::Error,
}; #[tokio::main]
async fn main() -> Result<(), Box<dyn Error + Sync + Send>> { let token = env::var("DISCORD_TOKEN")?; let config = Config::builder(&token).build(); let mut shard = Shard::new(config); shard.connect().await?; let mut events = shard.events(); while let Some(event) = events.next().await { match event { Event::Connected(connected) => { println!("Connected on shard {}", connected.shard_id); }, Event::Message(msg) => { if msg.content == "!ping" { http.send_message(msg.channel_id).content("Pong!").await?; } }, _ => {}, } }
}

