Below is a quick example of a program printing "Pong!" when a ping command comes in from a channel: use futures::StreamExt;
use dawn::{ command_parser::Parser, gateway::{Config, Event, Shard},
};
use std::{ env, error::Error,
}; #[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> { let token = env::var("DISCORD_TOKEN")?; let parser = Parser::builder() .prefix("!") .command("ping") .build(); let mut shard = Shard::builder(&token).build(); shard.connect().await?; let mut events = shard.events(); while let Some(event) = events.next().await { match event { Event::Message(msg) => match parser.parse(msg) { Output::Command { name: "ping", .. } => println!("Pong!"), _ => {}, }, _ => {}, } }
}

