All of the crates that are re-exported can be disabled. For example, if you need everything but voice, then you can disable only voice. This looks like: [dependencies.dawn]
default-features = false
features = ["cache", "command-parser", "gateway", "http", "model"]
git = "https://github.com/dawn-rs/dawn" This is the list of features, which are all enabled by default: cache command-parser gateway http model voice If you're developing a library, it's easier for users to know what you depend on by depending on the individual crates. If you're making a framework, this might look like: [dependencies]
dawn-cache = { git = "https://github.com/dawn-rs/dawn" }
dawn-gateway = { git = "https://github.com/dawn-rs/dawn" }
dawn-http = { git = "https://github.com/dawn-rs/dawn" }

